// frontend/src/FriendList.js
import React from 'react';

function FriendList({ friends }) {
  return (
    <div>
      <h2>送信された友達</h2>
      <ul>
        {friends.map((friend, index) => (
          <li key={index}>
            <p>名前: {friend.name}</p>
            <p>出身地: {friend.hometown}</p>
            <p>MBTI: {friend.mbti}</p>
            <p>趣味: {friend.hobby}</p>
            <p>好きな食べ物: {friend.favoriteFood}</p>
            {/* 名刺ボタンを追加することもできます */}
            <button onClick={() => alert(`名刺を表示: ${friend.name}`)}>名刺</button>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default FriendList;
